const passwordVisibilityToggle=(()=>{let l=document.querySelectorAll(".password-toggle");for(let o=0;o<l.length;o++){let t=l[o].querySelector(".form-control"),e=l[o].querySelector(".password-toggle-btn");e.addEventListener("click",e=>{"checkbox"===e.target.type&&(e.target.checked?t.type="text":t.type="password")},!1)}})();export default passwordVisibilityToggle;
